func killProcess(pid []int, ppid []int, kill int) []int {
	trees := make(map[int][]int)
	trees[0] = []int{}
	for i := 0; i < len(ppid); i++ {
		if _,ok := trees[ppid[i]];ok{
			trees[ppid[i]] = append(trees[ppid[i]], pid[i])
		}else{
			trees[ppid[i]] = []int{pid[i]}
		}
		
	}
	ret, st := make([]int, 0, len(pid)), make([]int, 0, len(pid))
	st, ret = append(st, kill), append(st, kill)
	
	for len(st) > 0{
		t := st[0]
		st = st[1:]
		_,ok := trees[t]
		if ok == false ||len(trees[t]) == 0 {
			continue
		}
		ret = append(ret, trees[t]...)
		st = append(st, trees[t]...)

	}
	return ret
}

